import "./App.css";
import {  Footer } from './components/index';
import { AddressPage } from "./pages/userProfile/address";
import {PublicRoute} from "./routes/public-routes/public-route"
function App() {
  return (
    <div className="App">
      <PublicRoute/>
      <AddressPage/>
      <Footer />
    </div>
  );
}

export default App;
